import React from 'react'
import ReactMarkdown from 'react-markdown'

export default function Blog() {
    return (
        <React.Fragment>
            <h1>이 자리에 블로그가 들어갈거에요</h1>
            <p>아직 열심히 만들고 있답니당</p>
        </React.Fragment>
    )
}
